using System;
using System.Diagnostics;
using System.Linq;
//using System.Numerics;
using System.Reflection;
using Microsoft.VisualStudio.TestTools.UnitTesting;

using System.Windows.Media.Media3D;
using Geometry3D;

namespace Geometry3DTests
{
    public class Item
    {
        public Object g1 { get; set; }
        public Object g2 { get; set; }
        public double d { get; set; }
    }

    [TestClass]
    public class GeometryTests
    {
        private void RunChecks(Item[] data)
        {
            var c = data.Length;

            Assert.AreNotEqual(0, c, "data array is empty");

            Type g1Type = null, g2Type = null;

            MethodInfo method = null;



            for (int i = 0; i < c; ++i)
            {
                var item = data[i];

                if (i == 0)
                {
                    g1Type = item.g1.GetType();
                    g2Type = item.g2.GetType();

                    var methods = typeof(Utilities).GetMethods().Where(m =>
                    {
                        if (m.Name != "ShortestLineSegmentBetween")
                            return false;

                        var parameters = m.GetParameters();

                        return parameters[0].ParameterType == g1Type && parameters[1].ParameterType == g2Type;
                    });

                    Assert.AreEqual(1, methods.Count(), "Suitable method not found.");

                    method = methods.First();
                }

                var precalculatedDistance = item.d;

                var lineSegment = (LineSegment3D)method.Invoke(null, new[] { item.g1, item.g2 });

                var calculatedDistance = lineSegment.Vector.Length;

                var differenceTolerance = 0.0005;

                var difference = Math.Abs(precalculatedDistance - calculatedDistance);

                Assert.IsTrue(difference <= differenceTolerance, String.Join("\r\n", new[]
                {
                    "Wrong 'calculated' distance.",
                    "Precalculated distance: " + precalculatedDistance,
                    "Calculated distance: " + calculatedDistance,
                    "Tolerance: " + differenceTolerance,
                    "Difference: " + difference.ToString("0." + new string('#', 339)),
                    "Data item index: " + i,
                    g1Type.Name + ": " + item.g1,
                    g2Type.Name + ": " + item.g2
                }));
            }
        }

        [TestMethod]
        public void Point2Point()
        {
            RunChecks(GeometryTestData.Point2PointData);
        }

        [TestMethod]
        public void Point2Line()
        {
            RunChecks(GeometryTestData.Point2LineData);
        }

        [TestMethod]
        public void Point2Triangle()
        {
            RunChecks(GeometryTestData.Point2TriangleData);
        }

        [TestMethod]
        public void Line2Line()
        {
            RunChecks(GeometryTestData.Line2LineData);
        }

        [TestMethod]
        public void Line2Triangle()
        {
            RunChecks(GeometryTestData.Line2TriangleData);
        }

        [TestMethod]
        public void Triangle2Triangle()
        {
            RunChecks(GeometryTestData.Triangle2TriangleData);
        }
    }

